import React, {useState,useEffect} from 'react'
import Headertwo from './Header2'
import Footer from '../components/Footer'
import { Card, Button, ListGroup } from 'react-bootstrap';
import { useParams } from 'react-router-dom';
import axios from 'axios';

function ReadData() {
    const {id}= useParams();
    const [rep,setRep]=useState([]);

    async function getData() {
        const response = await axios.get(`http://localhost:5000/recipes/${id}`).then((data)=>{
          setRep(data.data);
        });    

        console.log(response,"we have a response");
    }

    getData();

    console.log(id,"state data");
    const url = "data:image/jpeg;base64,";
  return (
   <>
   <Headertwo />
   {rep.map((item)=>(
        <Card style={{ width: '80vw' }} className="mx-auto mt-4">
        <Card.Img variant="top" src={url} className="m-3" style={{ maxWidth: '400px'}}/>
        <Card.Body>
            <Card.Title>{item.Title}</Card.Title>
            <ListGroup variant="flush">
            <ListGroup.Item >{item.ingredients}</ListGroup.Item>
            </ListGroup>
            <Card.Text><h4>preparation</h4><br />{item.description}</Card.Text>
            <Button variant="primary">
            Add to Cart
            </Button>
        </Card.Body>
        </Card>
   ))
   }
    <Footer /> 
   </>
  )
} 

export default ReadData
